import {
  AiOutlineHolder,
  AiOutlineQrcode,
  AiTwotoneAlert,
} from "react-icons/ai";

export default function Header() {
  const [toggle, setToggle] = useState(false);

  const toggleMenu = () => {
    setToggle(!toggle);
  };

  return (
    <div className="text-[#61dafb] header-container sticky top-0 flex justify-between  duration-300 shadow-2xl rounded-br-3xl rounded-bl-3xl">
      <a href="/">
        <div className="logo border-[#61dafb] border-2 rounded-lg">
          <img src={logo} className="h-[50px]" alt="Logo" />
        </div>
      </a>

      <ul className=" flex flex-row gap-5 font-bold text-[25px]">
